import React from 'react'
import Navbar from './Navbar'
const Header = () => {
  return (
    <div id='main'>
      <Navbar/>
      <div className='name'>
        <h1>It's a <span>ReactJS</span> </h1>
      </div>
    </div>
  )
}

export default Header
